  \"2016-07-27T23:04:49.895542\",\n\t\"name\": \"hydrogeomorphic-evaluation-of-ecosystem-restoration-and-management-options-for-erie-nation\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report provides a hydrogeomorphic
  (HGM) evaluation of ecosystem restoration options to assist future management of
  the Erie National Wildlife Refuge (NWR) in northwestern Pennsylvania. In 2008, a
  Comprehensive Conservation Plan (CCP) and Environmental Assessment were initiated
  for Erie NWR. Thecurrent HGM evaluation assists the CCP process and obtains and
  collates historical and current information about: 1) geology and geomorphology,
  2) soils, 3) topography and elevation, 4)hydrology, 5) aerial photographs and maps,
  6) plant and animal communities, and 7) physical anthropogenic features of the Erie
  NWR regions with the following objectives:1. Describe the pre-European settlement
  (hereafter Presettlement) ecosystem condition and ecological processes in the Erie
  NWR region.2. Document changes in the Erie NWR ecosystem from the Presettlement
  period.3. Identify restoration and management options incorporating ecological attributes
  needed to restore specific habitats and conditions.\",\n\t\"license_title\": \"License
